import React from 'react'

function InfoTile({ imgUrl, location }) {
    return (
        <div className="w-full relative bg-slate-600 max-w-xl flex flex-col items-center p-3 text-stone-20
                    cursor-pointer hover:bg-header-primary hover:scale-105 transition transform duration-200 ease-in-out">
            <img className='w-full h-80 object-cover z-0' alt='img-location' src={imgUrl} />
            {/* <h1 className="absolute font-sans font-bold  z-50 top-2/4 left-2/4 text-fuchsia-600">{location}</h1> */}
        </div>
    )
}

export default InfoTile
